import React from "react";
import './index.css';

function TableData({ data }) {
  return (
    <table>
      <tr>
        <th>Bank Name</th>
        <th>Branch</th>
        <th>Bank id</th>
        <th>ifsc</th>
        <th>Address</th>
      </tr>
    </table>
  );
}

export default TableData;
